import Carousel from "react-bootstrap/Carousel";
import I5 from "C:/Users/chesh/OneDrive/Desktop/Project2/src/Images/i5.jpg";
import I6 from "C:/Users/chesh/OneDrive/Desktop/Project2/src/Images/i6.png";
import I7 from "C:/Users/chesh/OneDrive/Desktop/Project2/src/Images/i7.png";
function Carousels() {
  return (
    <Carousel slide={false}>
      <Carousel.Item>
        <img
          className="d-block w-100"
          style={{ height: "500px" }}
          src={I5}
          alt=""
        />
      </Carousel.Item>
      <Carousel.Item>
        <img
          className="d-block w-100"
          style={{ height: "500px" }}
          src={I7}
          alt=""
        />
      </Carousel.Item>
      <Carousel.Item>
        <img
          className="d-block w-100"
          style={{ height: "500px" }}
          src={I6}
          alt=""
        />
      </Carousel.Item>
    </Carousel>
  );
}

export default Carousels;
